// src/components/Card.jsx
import React from 'react';
import './Card.css';

function Card({ title, count, emoji, color }) {
  return (
    <div className="card" style={{ borderTop: `5px solid ${color}` }}>
      <h3>{emoji} {title}</h3>
      <p className="count">{count}</p>
    </div>
  );
}

export default Card;
